import React from 'react';
import Header from './Header';
import Meta from './Meta';
import styled from 'styled-components';

const MyButton = styled.button`
  background: red;
  font-size: 100px;
`;

export default props => (
  <div>
    <Meta />
    <Header />
    <MyButton>click</MyButton>
    {props.children}
  </div>
);
